import { Button, ButtonGroup, Grid, TextField } from '@material-ui/core';
import React from 'react';
import image from './image.jpg';


const buttons = [
    <Button key = "git">Sign in using GitHub</Button>,
    <Button key = "google">Sign in using Google Account</Button>,
    <Button key = "exist">Sign in using exist account</Button>
];

const useStyles = makeStyles((theme)=>({
    menuButton : {
        marginRight : theme.spacing(2),
    },
    title : {
        display: 'none',
        [theme.breakpoints.up('sm')] : {
            display:'block',
        }
    },
    iamge:{
        width : '100%',
        height : '100'
    }
}));

export default function Login () {
    const classes = useStyles();// className = {classes.menuButton}


    return(
        <Grid container>
            <Grid item xs = {0} sm = {6}>
                <img src = {image} width = "100%" height = "100%"/>
            </Grid>
            <Grid item container xs = {12} sm = {6}>
                <ButtonGroup orientation = 'vertical' >
                    {buttons}
                </ButtonGroup>
            </Grid>
        </Grid>
    );
}
